const elements = contacts.map(({ id, name, number }) => (
    <li key={id} > {name}: {number}
        <button onClick={() => deleteContact(id)}>Delete</button>
    </li>
));
    return (
        <ul>{elements}</ul>
    )
}

export default ContactList;
